import React, { Component } from 'react'
import { Link } from 'react-router-dom'

import employee from '../images/employee.svg'
import statu from '../images/statu.svg'
import criteria from '../images/criteria.png'

const { promisify } = require('util')
const sleep = promisify(setTimeout)

export class index extends Component {

    state = {
        currentAdmin: JSON.parse(localStorage.getItem('currentAdmin'))
    }

    deleteLocal = () => {
        localStorage.clear();
    }


    render() {
        sleep(1000).then(() => {
        let currentAdmin = JSON.parse(localStorage.getItem('currentAdmin'));
        console.log({currentAdmin});
        console.log(this.state.currentAdmin)
          })
       
        return (
            <div className="center60">
{/*                 {this.getEmployee()} */}
                <div className="col3">
                    <Link to="/employee">
                        <img src={employee} alt="employee" />
                        <h4><i>EMPLOYEES</i></h4>
                    </Link>
                </div>
                <div className="col3">
                    <Link to="/statu">
                        <img src={statu} alt="statu" />
                        <h4><i>STATU</i></h4>
                    </Link>
                </div>
                <div className="col3">
                    <Link to="/criteria">
                        <img src={criteria} alt="criteria" />
                        <h4><i>CRITERIA</i></h4>
                    </Link>
                </div>
                <button onClick={this.deleteLocal}>delete</button>
            </div>
        )
    }
}

export default index
